// Imports
import axios from "axios";
import React, { useEffect, useState } from "react";
// Styles
import './styles/politicasStyle.css'

// Component 
const Politicas = ({id}) => {

    const [data, setData] = useState()

    useEffect(() => {
        axios.get(`http://ec2-3-145-180-105.us-east-2.compute.amazonaws.com:8080/productos/${id}`)
          .then(function (response) {
            setData(response.data);
            console.log(response.data)
          })
          .catch(function (error) {
            console.log(error);
          });
      }, [id]);

      console.log(data);

    return(
        <React.Fragment>
            <div className = "Politicas_div">
                <h4>Que tenes que saber</h4>
                <div className = "div_div">
                    <div>
                        <h6>Normas de la casa</h6>
                        <ul>
                            <li>{data.normasCasa}</li>
                        </ul>
                    </div>
                    <div>
                        <h6>Salud y seguridad</h6>
                        <ul>
                            <li>{data.medidasSaludSeguridad}</li>
                        </ul>
                    </div>
                    <div>
                        <h6>Politicas de cancelacion</h6>
                        <ul>
                            <li>Sample text 1</li>
                        </ul>
                    </div>
                </div>
            </div>
        </React.Fragment>
    );
}

// Exports
export {Politicas};
